import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function Header() {
  return (
    <View style={styles.container}>
      
    </View>
  )
}

const styles = StyleSheet.create({
    container:{
        height:35,
        backgroundColor:"#127cc0",
    },
})
